import React from "react";
import { Link } from "react-router-dom";

function Navbar() {
  return (
    <div>
      <ul className="nav-links">
        <Link href="/login">
          <li /> Login
        </Link>

        <Link href="/">
          <li />Home
        </Link>

        <Link href="/profile">
          <li />Profile
        </Link>
      </ul>
    </div>
  );
}

export default Navbar;
